    public int minDominoRotations(int[] A, int[] B) {
        int len = A.length;
        int count = 0;//和A[0]相同的数字
        int i = 0;
        for (i = 0; i < len; i++) {
            if (A[i] == A[0]) {
                //二者相等，不用交换
                continue;
            } else if (B[i] == A[0]) {
                count++;
            } else {
                break;
            }
        }
        int res=-1;
        if (i == len) {
            res= count;
        }
        count = 0;
        for (i = 0; i < len; i++) {
            if (B[i] == B[0]) {
                //二者相等，不用交换
                continue;
            } else if (A[i] == B[0]) {
                count++;
            } else {
                break;
            }
        }
        if (i == len) {
            if (res==-1) {
                res = count;
            }else{
                res=Math.min(res,count);
            }
        }
        return res;
    }
